import{_ as e,o as t,c as a,O as o}from"./chunks/framework.ee05e8ef.js";const w=JSON.parse('{"title":"Frequently Asked Question ✍","description":"","frontmatter":{},"headers":[],"relativePath":"en/faq.md","filePath":"en/faq.md"}'),i={name:"en/faq.md"},s=o('<h1 id="frequently-asked-question-✍" tabindex="-1"><a href="https://github.com/legat-ai/www/blob/main/DOCS/FAQ.md" target="_blank" rel="noreferrer">Frequently Asked Question</a> <a href="https://github.com/legat-ai/www/edit/main/DOCS/FAQ.md" target="_blank" rel="noreferrer"><span style="font-size:20px;">✍</span></a> <a class="header-anchor" href="#frequently-asked-question-✍" aria-label="Permalink to &quot;[Frequently Asked Question](https://github.com/legat-ai/www/blob/main/DOCS/FAQ.md) [&lt;span style=&#39;font-size:20px;&#39;&gt;&amp;#x270D;&lt;/span&gt;](https://github.com/legat-ai/www/edit/main/DOCS/FAQ.md)&quot;">​</a></h1><p>Different between nocode, lowcode</p><p>What is RPA</p><p>What is Text2Software?</p><p>www.text2software.com</p><p>What is necessary to make this project successful?</p><p>Community is the key. This project provides a solution for many people, but it also offers an opportunity for many more. Each application, library, adapter, robot, and sensor created with compatibility for this system can be made by a third party, and we can help by selling them through our shop. We can also assess security and sign under their project. This project has a great potential for growth if the community decides to use it or make money from it. Each hour spent working on the application for this project serves to automate the process for everyone who already owns this product.Every robot that is compatible with this product has limited working potential. However, it does not require complex logic and tons of sensors to be useful. All of that is managed by our Robo Assistance, which gives the robot a significant advantage over competitors: less logic and sensors means that the robot can be more reliable, cheaper, faster, and easier to produce while still making a lot of things, and those &quot;things&quot; can grow over time, thanks to the application system.</p><p>What are the chances that this project will succeed?</p><p>People need a solution to manage all of this and make it simpler for them to adapt and expand their technological stack. The demand for new technology is high, as is the demand for robotics and smart solutions. Additionally, nobody else is even close (apart from us) to taking advantage of Metaverse&#39;s enormous opportunity to turn virtual reality into reality! However, we are aware of the logistical issues, the rising costs of many dependent elements, and the current global financial crisis. Moreover, just 50% of the world&#39;s population requires such a solution. Another risk is entering the market too soon and missing out on the potential (a problem with the first Mac). Furthermore, this product&#39;s abstract and tool nature make marketing challenges.</p><p>Czym jest a czym nie jest legat AI?</p><ul><li><p>to idea tworzenia oprogramowania z już istniejących klocków-modułów opensource</p></li><li><p>nie jest rozwiązaniem kradnącym kod, niczym znany #cobot, który nie respektuje twórców, łamiąc licencję i prywatność.</p></li></ul><p>Dlaczego powstaje taka platforma?</p><ul><li>aby pomóc młodym twórcom w nauce języków programowania, dając im możliwość startu na własnym komputerze lokalnie, niezależnie od dostępu do internetu, raz pobrany kod zostaje na komputerze.</li></ul><p>Ile kosztuje dostęp do legat AI?</p><ul><li>aplikacja do generowania kodu jest darmowa, kosztem są zapytania API, które wymagają mocy obliczeniowej, 1 zapytanie to 1 cent USD</li></ul><p>Jakie możliwości stoją przed legat AI?</p><ul><li>w tym roku będzie dostępna wersja testowa aplikacji na komputer do celów testowania już istniejącego kodu</li><li>w roku 2023 będzie dostępna możliwości korzystania z wielu marketplace-ów oraz możliwość tworzenia własnego.</li></ul><p>Kosztem będzie tylko zapytanie, bez miesięcznych stałych kosztów.</p><p>Jesteśmy otwarci na pytania, zapraszamy na stronę:</p>',19),n=[s];function r(l,p,c,m,d,h){return t(),a("div",null,n)}const y=e(i,[["render",r]]);export{w as __pageData,y as default};
